import React from 'react';
import './Header.css';


const Header = () => {
    return (
        <header className="header header_dark-bg">
            <nav className="header__navbar">
                <img className="header__logo" src="assets/images/logo.svg" alt="Логотип"/>
                <div className="header__links">
                    <a href="" className="header__navlink">Регистрация</a>
                    <button className="header__button">Войти</button>
                </div>
            </nav>
        </header>
    );
};

export default Header;
